's Chi-squared test with Yates' continuity correction\n","\n","data:  table_financial_suicidal\n","X-squared = 107.29, df = 1, p-value < 2.2e-16\n","\n"]}],"source":["table_financial_suicidal <- table(depression_clean$suicidal_thoughts, depression_clean$depression)\n","print(table_financial_suicidal)\n","chi_sq_result_fs <- chisq.test(table_financial_suicidal)\n","print(chi_sq_result_fs)\n","\n","# X-squared: Chi-squared statistic. \n","# df: Degrees of freedom \n","# p-value: Less than 0.05 suggests a significant correlation."]},{"cell_type":"markdown","id":"df2f54db","metadata":{"papermill":{"duration":0.029139,"end_time":"2025-01-03T02:01:32.784572","exception":false,"start_time":"2025-01-03T02:01:32.755433","status":"completed"},"tags":[]},"source":["The results provide strong evidence that financial stress is significantly associated with suicidal thoughts. This implies that interventions addressing financial stress could potentially have a positive effect on reducing the risk of suicidal thoughts among students."]},{"cell_type":"markdown","id":"c38daa28","metadata":{"execution":{"iopub.execute_input":"2024-12-30T18:48:47.674037Z","iopub.status.busy":"2024-12-30T18:48:47.672069Z","iopub.status.idle":"2024-12-30T18:48:47.687193Z","shell.execute_reply":"2024-12-30T18:48:47.68507Z"},"papermill":{"duration":0.028822,"end_time":"2025-01-03T02:01:32.842263","exception":false,"start_time":"2025-01-03T02:01:32.813441","status":"completed"},"tags":[]},"source":["## Act Phase"]},{"cell_type":"markdown","id":"4fc1b072","metadata":{"papermill":{"duration":0.029279,"end_time":"2025-01-03T02:01:32.900634","exception":false,"start_time":"2025-01-03T02:01:32.871355","status":"completed"},"tags":[]},"source":["**The analysis reveals several key factors strongly associated with depression among students:**\n","- High Academic Pressure, Low Study Satisfaction, High Financial Stress and Unhealthy Dietary Habits.\n","\n","**Age group that should be prioritized for mental health interventions**\n","- The 18–22 age group should be prioritized for mental health interventions. This group exhibits the highest levels of depression, suicidal thoughts, and sensitivity to factors such as academic pressure and financial stress.\n","\n","**Based on the findings, the following programs could be implemented:**\n","- Academic Pressure Management:\n","  Introduce time management and study skills workshops to help students cope with academic demands and work with faculty to develop a more balanced curriculum and exam schedules to reduce academic pressure.\n","\n","- Financial Support Programs:\n","  Provide financial aid, scholarships, or subsidized counseling to alleviate financial stress and offer workshops on financial literacy to help students manage their resources effectively.\n","\n","- Mental Health Awareness Campaigns:\n","  Target the 18–22 age group with awareness campaigns to destigmatize mental health and  encourage students to seek help.\n","\n","- Counseling Services:\n","  Offer accessible counseling services\n","\n","- Nutritional Support:\n","  Provide healthy, affordable meal options on campus.\n"]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":5868381,"sourceId":9616093,"sourceType":"datasetVersion"}],"dockerImageVersionId":30749,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.4.0"},"papermill":{"default_parameters":{},"duration":15.734299,"end_time":"2025-01-03T02:01:33.052097","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2025-01-03T02:01:17.317798","version":"2.6.0"}},"nbformat":4,"nbformat_minor":5}